import React from "react";

const RecipeFilters = ({ filters }) => {
  return (
    <ul className="col-auto list-group p-0 rounded-0">
      <li className="list-group-item">Filters</li>
      {filters.map((filter) => (
        <li className="list-group-item" key={filter._id}>
          {filter.name}
        </li>
      ))}
    </ul>
  );
};

export default RecipeFilters;
